(2, 'Natick', ' \n<table class="noborders"><colgroup><col width="33.3%"><col width="33.3%"><col width="33.3%"></colgroup><tbody> <tr><td><br></td><td> <img src="data:image/jpeg;base64," width="125" height="25"></td><td><br></td></tr></tbody></table>', '    \n\n\n\n\n<h4><b>Congratulations&nbsp;{studentname}</b><b></b></h4>\n    \n\n\n\n\n<p><font size="2">Your diligent effort, improvement in martial arts skills, and Black Belt Attitude has earned you the privilege of nomination for graduation. Your graduation review is scheduled on {certDate} at {teststarttime} . Please invite your family and friends to witness your achievement and feel free to bring a camera or video recorder to capture this important moment on your journey to Black Belt.</font></p>\n\n\n<p></p>\n\n<ul>\n	\n	<li><font size="2"><b>Please have a Villari’s patch sewn in on the left front of uniform.</b></font><br></li>\n	\n	<li><font size="2"><b>Bring your Gi, sneakers, sparring gear and leadership weapons to the review.</b></font><br></li>\n\n</ul>\n\n<p></p>\n\n\n\n<p><font size="2">Please tear off the Notice of Intent to Promote, have it filled out by your parents and school teacher, and return it the week before your graduation along with the test fee of ${testfee}. This will ensure that we understand how the student is performing outside the dojo and have the correct spelling on the certificate of promotion.</font></p>\n\n\n<p><font size="2">Good luck!<br>Your Sensei</font><br></p>\n\n\n<div><hr class="dashed"></div>\n\n\n<h4>Notice of Intent to Promote</h4>\n\n\n<h5><b>Parents and Teachers</b></h5>\n\n\n<p><font size="2">It is our main objective in the community to develop well-rounded students, in their school, at home and in our Martial Arts school. We would appreciate your feedback on the following student. This form will not dictate if this student will or will not take their promotion test. We value your opinion as their success coach at school and/or home.</font></p>\n\n\n<h5><b>Student''s